Historia larga hecha corta:
Tenía un casting, me pedían a demás de una escena larguísima en una lengua que no es la mía, un maquillaje muy específico. 
Estudié muchísimo y tenía todo aparentemente listo, pero como no soy muy diestra maquillándome (lo mío es el maquillaje natural) llame a un equipo al que literalmente, le confiaría mis sueños. 
@natheoso_ me maquilló con todo lo que tenía en mi bolsa, obvio de @natura.colombia y con lo que no me puede faltar, mi lápiz de cejas. (este es retráctil, que es todo lo que está bien) y así logró que mis ojos hablaran. #ojosnatura y 
@julianrios.a que hizo este video divino ¡gracias por ser tan paciente conmigo! 
Al final, el personaje no era para mi 😂 pero me divertí muchísimo. me quedó este video bonito y de paso les dejo una idea para Halloween que ya está a la vuelta de la esquina 😏

Enjoy 
